mEGame mCRisenName::s_enuGame = mEGame_Risen3;
mTNameMap< MIU32 > mCRisenName::s_mapRisenHashes;
mTMap< MIU32, mCName > mCRisenName::s_mapRisenNames;
mTNameMap< MIInt > mCRisenName::s_mapRisen3EnumValues;
mTNameMap< MIInt > mCRisenName::s_mapElexEnumValues;

mCRisenName::mCRisenName( mCString const & a_strString ) :
    mCName( a_strString )
{
}

mCRisenName::mCRisenName( MIU32 a_u32Hash )
{
    s_mapRisenNames.GetAt( a_u32Hash, *this );
}

mCRisenName::mCRisenName( mCName const & a_nameSource ) :
    mCName( a_nameSource )
{
}

mCRisenName::mCRisenName( void )
{
}

mEGame mCRisenName::GetGame( void )
{
    return s_enuGame;
}

void mCRisenName::SetGame( mEGame a_enuGame )
{
    s_enuGame = a_enuGame;
}

void mCRisenName::InitializeGameStrings( void )
{
    switch ( s_enuGame )
    {
    case mEGame_Risen2:
        InitializeRisen2Strings();
        break;
    case mEGame_Risen3:
        InitializeRisen3Strings();
        break;
    case mEGame_Elex:
        InitializeElexStrings();
        break;
    default:
        break;
    }
}

void mCRisenName::InitializeRisen2Strings( void )
{
    static MIBool s_bRegistered = MIFalse;
    if ( s_bRegistered )
        return;
    s_bRegistered = MITrue;
    RegisterNameStrings( s_arrRisen2Classes, sizeof( s_arrRisen2Classes ) / sizeof( s_arrRisen2Classes[ 0 ] ) );
    RegisterNameStrings( s_arrRisen2Enums, sizeof( s_arrRisen2Enums ) / sizeof( s_arrRisen2Enums[ 0 ] ) );
    RegisterNameStrings( s_arrRisen2Prop, sizeof( s_arrRisen2Prop ) / sizeof( s_arrRisen2Prop[ 0 ] ) );
}

void mCRisenName::InitializeRisen3Strings( void )
{
    static MIBool s_bRegistered = MIFalse;
    if ( s_bRegistered )
        return;
    s_bRegistered = MITrue;
    RegisterNameStrings( s_arrRisen3Classes, sizeof( s_arrRisen3Classes ) / sizeof( s_arrRisen3Classes[ 0 ] ) );
    RegisterNameStrings( s_arrRisen3Enum, sizeof( s_arrRisen3Enum ) / sizeof( s_arrRisen3Enum[ 0 ] ) );
    RegisterNameStrings( s_arrRisen3Prop, sizeof( s_arrRisen3Prop ) / sizeof( s_arrRisen3Prop[ 0 ] ) );
    RegisterNameStrings( s_arrRisen3Scripts, sizeof( s_arrRisen3Scripts ) / sizeof( s_arrRisen3Scripts[ 0 ] ) );
    s_mapRisen3EnumValues.Reserve( sizeof( s_arrRisen3Enum ) / sizeof( s_arrRisen3Enum[ 0 ] ) );
    for ( MIUInt u = 0, ue = sizeof( s_arrRisen3Enum ) / sizeof( s_arrRisen3Enum[ 0 ] ); u != ue; ++u )
        s_mapRisen3EnumValues[ mCRisenName( s_arrRisen3Enum[ u ] ) ] = s_arrRisen3EnumValues[ u ];
}

void mCRisenName::InitializeElexStrings( void )
{
    static MIBool s_bRegistered = MIFalse;
    if ( s_bRegistered )
        return;
    s_bRegistered = MITrue;
    RegisterNameStrings( s_arrElexClasses, sizeof( s_arrElexClasses ) / sizeof( s_arrElexClasses[ 0 ] ) );
    RegisterNameStrings( s_arrElexEnum, sizeof( s_arrElexEnum ) / sizeof( s_arrElexEnum[ 0 ] ) );
    RegisterNameStrings( s_arrElexProp, sizeof( s_arrElexProp ) / sizeof( s_arrElexProp[ 0 ] ) );
    RegisterNameStrings( s_arrElexScripts, sizeof( s_arrElexScripts ) / sizeof( s_arrElexScripts[ 0 ] ) );
    s_mapElexEnumValues.Reserve( sizeof( s_arrElexEnum ) / sizeof( s_arrElexEnum[ 0 ] ) );
    for ( MIUInt u = 0, ue = sizeof( s_arrElexEnum ) / sizeof( s_arrElexEnum[ 0 ] ); u != ue; ++u )
        s_mapElexEnumValues[ mCRisenName( s_arrElexEnum[ u ] ) ] = s_arrElexEnumValues[ u ];
}

void mCRisenName::RegisterNameStrings( MILPCChar const * a_pStrings, MIUInt a_uCount )
{
    s_mapRisenHashes.Reserve( a_uCount * 5 / 3 + s_mapRisenHashes.GetCount() );
    s_mapRisenNames.Reserve( a_uCount * 5 / 3 + s_mapRisenNames.GetCount() );
    for ( MIUInt u = a_uCount; u--; )
    {
        mCName nameTemp( a_pStrings[ u ] );
        MIU32 u32Hash = g_djb2( a_pStrings[ u ] );
        mCName & nameDest = s_mapRisenNames[ u32Hash ];
        if ( nameDest.GetID() && nameDest != nameTemp )
            MI_ERROR( mCError, EGeneral, "Hash collision." );
        nameDest = nameTemp;
        s_mapRisenHashes[ nameTemp ] = u32Hash;
    }
}

mCIStreamBinary & mCRisenName::operator << ( mCIStreamBinary & a_streamSource )
{
    *this = mCRisenName( a_streamSource.ReadU32() );
    return a_streamSource;
}

mCOStreamBinary & mCRisenName::operator >> ( mCOStreamBinary & a_streamDest ) const
{
    a_streamDest << GetRisenID();
    return a_streamDest;
}

MIBool mCRisenName::GetEnumValue( MIInt & a_iDest ) const
{
    return s_mapRisen3EnumValues.GetAt( *this, a_iDest ) || s_mapElexEnumValues.GetAt( *this, a_iDest );
}

MIU32 mCRisenName::GetRisenID( void ) const
{
    MIU32 u32Result = 0;
    s_mapRisenHashes.GetAt( *this, u32Result );
    return u32Result;
}

mCIStreamBinary & operator >> ( mCIStreamBinary & a_streamSource, mCRisenName & a_nameDest )
{
    return ( a_nameDest << a_streamSource );
}

mCOStreamBinary & operator << ( mCOStreamBinary & a_streamDest, mCRisenName const & a_nameSource )
{
    return ( a_nameSource >> a_streamDest );
}
